import "./App.css";
import { BrowserRouter, Route } from "react-router-dom";
// import MenuNav from "./components/landing/MenuNav";
import Main from "./components/landing/Main";
import LaMarque from "./components/landing/LaMarque";
import LaCollection from "./components/landing/LaCollection";
import Acordeon from "./components/landing/Acordeon";

function App() {
  return (
    <div className="contenedor_principal">
      <div className="contenedor_menu_vertical">{/* <MenuNav /> */}</div>
      <div className="contenedor_contenidos">
        <BrowserRouter>
          <Main />

          <Route path="./components/landing//LaMarque.js">
            <LaMarque />
          </Route>
          <Route path="./components/landing/LaCollection.js">
            <LaCollection />
          </Route>
          <Route path="./components/landing/Acordeon.js">
            <Acordeon />
          </Route>
        </BrowserRouter>
      </div>
    </div>
  );
}

export default App;
